package com.proyecto.modelo;

public class Presentacion {
	private int idPresentacion;
	private String descripcionPres;
	
	public Presentacion() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Presentacion(int idPresentacion, String descripcionPres) {
		super();
		this.idPresentacion = idPresentacion;
		this.descripcionPres = descripcionPres;
	}
	public int getIdPresentacion() {
		return idPresentacion;
	}
	public void setIdPresentacion(int idPresentacion) {
		this.idPresentacion = idPresentacion;
	}
	public String getDescripcionPres() {
		return descripcionPres;
	}
	public void setDescripcionPres(String descripcionPres) {
		this.descripcionPres = descripcionPres;
	}
	
	
	




	
}
